  false,\n\t\"url\": null,\n\t\"notes\": \"Multibeam and single beam data will be
  collected 24 hours a day and XBT casts will be conducted at an interval defined
  by prevailing oceanographic conditions, but not to exceed 6 hours. Additionally,
  EK 60 and sub-bottom profile data will be collected 24 hours per day. A new EK80
  instrument will be tested.  The Okeanos Explorer will continue to host NASA's Maritime
  Aerosol Network sensors to provide ship-borne aerosol optical depth measurements
  from sun photometers for NASA.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
